
CREATE TABLE IF NOT EXISTS `food` (
  `fid` int(11) NOT NULL AUTO_INCREMENT COMMENT '번호',
  `category` varchar(100) CHARACTER SET utf8 COLLATE utf8_unicode_ci NOT NULL DEFAULT '' COMMENT '식품군',
  `foodname` varchar(100) CHARACTER SET utf8 COLLATE utf8_unicode_ci NOT NULL DEFAULT '' COMMENT '식품이름',
  `per` varchar(50) CHARACTER SET utf8 COLLATE utf8_unicode_ci DEFAULT NULL COMMENT '1회 제공량',
  `kcal` varchar(50) CHARACTER SET utf8 COLLATE utf8_unicode_ci DEFAULT NULL COMMENT '열량,칼로리',
  `carbo` varchar(50) CHARACTER SET utf8 COLLATE utf8_unicode_ci DEFAULT NULL COMMENT '탄수화물',
  `protein` varchar(50) CHARACTER SET utf8 COLLATE utf8_unicode_ci DEFAULT NULL COMMENT '단백질',
  `fat` varchar(50) CHARACTER SET utf8 COLLATE utf8_unicode_ci DEFAULT NULL COMMENT '지방',
  `sugar` varchar(50) CHARACTER SET utf8 COLLATE utf8_unicode_ci DEFAULT NULL COMMENT '당',
  `natrium` varchar(50) CHARACTER SET utf8 COLLATE utf8_unicode_ci DEFAULT NULL COMMENT '나트륨',
  `chole` varchar(50) CHARACTER SET utf8 COLLATE utf8_unicode_ci DEFAULT NULL COMMENT '콜레스테롤',
  `satfat` varchar(50) CHARACTER SET utf8 COLLATE utf8_unicode_ci DEFAULT NULL COMMENT '포화지방산',
  `transfat` varchar(50) CHARACTER SET utf8 COLLATE utf8_unicode_ci NOT NULL DEFAULT '' COMMENT '트렌스지방산',
  PRIMARY KEY (`fid`)
) ENGINE=InnoDB AUTO_INCREMENT=12100 DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_unicode_ci;

